Peiso ea PC ea Hammer Wheel, Papali ea 180 Degree Wheel Vibration Motor Driving Racing e nang le Lisebelisoa tsa ho Araba le Pedals, e nang le Pedals bakeng sa PS3, PS4, Xbox One, Power Switch
5 HO 1 LEBITSO LA RACING: E lumellana le Xbox one / PC / PS3 / PS4 / Nintendo Switch;
Moralo oa phetoho ea matsoho: Etsisa ho khanna ha 'nete le ho ntlafatsa monate oa taolo;
SEBELISA "Tlhōlisano" moralo oa lebili: tse peli tsa mabelo mabili ho khanna maikutlo a dijithale ho fana ka phihlelo ea sebele dipapadi, bohlale ho intša fetola maemo a sisinyeha ho maemo a fapaneng ho ea ka ho khanna scene bang bang bang.10.24inch / 26cm bophara, le moralo ergonomic;
Potoloho ea likhato tse 180: Moralo oa ergonomics oa mabelo a mabelo, li-angles tse 180 tse potolohang le ho ts'oara rabara;
Ketsiso ea ho mena lipedali tse nang le khase le taolo ea braking.
